INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (1, 'Rust', 3, 'IntelliJ Rust is an open-source Rust plugin compatible with all IntelliJ-based IDEs. In pair with IntelliJ TOML, it aims at bringing full IDE experience to your workflow with Rust and Cargo.', '3', 1, , 452, '2021-11-30', '1', 'https://github.com/tdgeorgieva/addon-test', 1);
INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (2, 'VsVim', 39, 'This is a Vim Emulation layer for Visual Studio 2015 and above. It integrates the familiar key binding experience of Vim directly into Visual Studio''s editor.  ', '3', 2, , 144, '2021-12-01', '1', 'https://github.com/VsVim/VsVim', 1);
INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (4, 'VSColorOutput', 37, 'VSColorOutput hooks into the classifier chain of Visual Studio. This allows VSColorOutput to monitor every line sent to the output window. A list of classifiers, consisting of regular expressions and classifications is checked. The first matching expression determines the classification. If no patterns match, then the line is classified as BuildText.', '3', 3, , 135, '2021-12-06', '0', 'https://github.com/tdgeorgieva/addon-test', 0);
INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (8, 'ReSharper', 46, 'ReSharper is a popular developer productivity extension for Microsoft Visual Studio. It automates most of what can be automated in your coding routines. It finds compiler errors, runtime errors, redundancies, and code smells right as you type, suggesting intelligent corrections for them.
INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (9, 'Serene', 26, 'Serenity is an ASP.NET Core / TypeScript application platform designed to simplify and shorten development of data-centric business applications with a service based architecture. Serene is a starter template to build Serenity applications. Serenity is best suited to business applications with many data entry forms, administrative interface of public facing web sites, and mobile application back ends.', '0', 3, , 0, '2021-12-10', '0', 'https://github.com/serenity-is/Serenity', 0);
INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (10, 'Visual Assist', 26, 'Productivity tool for C/C++ and C# that improves IDE features related to navigation, refactoring, code generation, and coding assistance along with specific tooling for UE4.', '3', 3, , 1, '2021-12-10', '0', 'https://github.com/tdgeorgieva/addon-test', 0);
