INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (22, 'Custom Postfix Templates', 43, 'This open source plugin lets you define your own postfix templates for Java, Scala, SQL, PHP, Kotlin, Python, Dart, JavaScript, Ruby, Rust, Go and Groovy. It also comes with hundreds of useful postfix templates shared by the community. You''re welcome to contribute your templates as well. Apart from the community approach, how does the plugin differ from IDEA''s postfix templates? Since IDEA 2018 you are now able to define your own postfix templates for some languages in the settings UI (Editor - General - Postfix Templates). However, this is a pretty new feature and it''s less functional than this plugin. Here are some of the advantages of this plugin', '0', 3, , 0, '2021-12-12', '0', 'https://github.com/xylo/intellij-postfix-templates', 0);
INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (23, 'Browser Sync', 39, 'A Visual Studio extension for ASP.NET projects that leverages Browser Link to synchronize form field entry, page navigation and scroll position.', '1', 3, , 0, '2021-11-18', '0', 'https://github.com/madskristensen/browsersync', 0);
INSERT INTO addonis.addons (addon_id, name, creator_user_id, description, status, ide_id, image, downloads_count, upload_date, type, link, is_featured) VALUES (24, 'Teamscale Integration for Eclipse', 42, 'The Teamscale Integration for Eclipse allows for seamless browsing of quality defects found by the Teamscale software-quality analysis server. Teamscale analyzes your source code incrementally with every commit, providing feedback on the quality of your code in near real-time. (Note: An existing Teamscale Server is necessary to use this plugin!)', '0', 4, , 0, '2021-09-14', '0', 'https://github.com/tdgeorgieva/addon-test', 0);
